import React, { useEffect, useState, useRef } from "react";

import IconButton from '@mui/material/IconButton';
import SvgIcon from '@mui/material/SvgIcon';

function SvgButton(props) {

  let typeList = useRef(
    {"blank": "",
     "menu": "M3 18h18v-2H3v2zm0-5h18v-2H3v2zm0-7v2h18V6H3z",
     "tree": "M 0 3.1875L 0 2.1875L -1 2.1875L -1 3.1875L 0 3.1875ZM 0 13L -1 13L -1 14L 0 14L 0 13ZM 11 0L 11 -1L 10 -1L 10 0L 11 0ZM 11 6L 10 6L 10 7L 11 7L 11 6ZM 6 10L 6 9L 5 9L 5 10L 6 10ZM 6 16L 5 16L 5 17L 6 17L 6 16ZM -1 3.1875L -1 13L 1 13L 1 3.1875L -1 3.1875ZM 10 0L 10 6L 12 6L 12 0L 10 0ZM 5 10L 5 16L 7 16L 7 10L 5 10ZM 6 17L 14 17L 14 15L 6 15L 6 17ZM 6 11L 14 11L 14 9L 6 9L 6 11ZM 0 14L 5 14L 5 12L 0 12L 0 14ZM 0 4.1875L 11 4.1875L 11 2.1875L 0 2.1875L 0 4.1875ZM 11 7L 17 7L 17 5L 11 5L 11 7ZM 11 1L 17 1L 17 -1L 11 -1L 11 1Z"}
  )

  let [type, setType] = useState(typeList.current["blank"])

  useEffect(() => {
    if (Object.keys(typeList.current).includes(props.type)) {
      setType(typeList.current[props.type])
    } else {
      setType(typeList.current["blank"])
    }
  }, [props.type])

  return (
<p>
  Menu:&nbsp;
  <IconButton size="small" sx={{width: 24, height: 24, backgroundColor: "#ddd", boxShadow: "-1px 1px 2px", "&:hover": {boxShadow: "-2px 2px 3px", backgroundColor: "#eee"}}}>
    <SvgIcon sx={{width: 20, height: 20}}>
      <path d={type}></path>
    </SvgIcon>
  </IconButton>
</p>
  )
}

export default SvgButton;
